                    </div>
                </div>
                <div id="aprovacao-conferencia">
                    <div class="infos-copo-gabarito">
                        <p>
                            <strong>Modelo:</strong>
                            Eco Vaso® <span class="cor-modelo">Translúcido Blanco</span>
                            <span class="size-name">360cc</span>
                        </p>
                        <p class="mg-top-10">
                            <strong>Colores de impresión:</strong>
                        </p>
                        <div class="cores-de-impressao-gabarito"></div>
                    </div>
                    <div id="box-conferencia">
                        <div class="bg-cinza">
                            <h4 class="eu-conferi">Apruebo:</h4>
                            <div class="row-checkbox">
                                <input type="checkbox" id="tamanho-checked" class="checkbox-conferencia">
                                <label for="tamanho-checked">tamaño</label>
                                <br/>
                            </div>
                            <div class="row-checkbox">
                                <input type="checkbox" id="cor-checked" class="checkbox-conferencia">
                                <label for="cor-checked">colores</label>
                                <br/>
                            </div>
                            <div class="row-checkbox">
                                <input type="checkbox" id="conteudo-checked" class="checkbox-conferencia">
                                <label for="conteudo-checked">contenido</label>
                                <br/>
                            </div>
                            <div class="row-checkbox">
                                <input type="checkbox" id="cores-checked" class="checkbox-conferencia">
                                <label for="cores-checked">colores de impresión</label>
                                <br/>
                            </div>
                        </div>
                        <div id="aprovado" data-medida="360cc(12oz)">aprobar</div>
                        <div class="fechar-box-aprovacao" id="alterar-aprovacao">modificar</div>
