                        </label>
                        <input name="img" type="file" id="logo" hidden accept="image/png, image/jpeg">
                    </form>
                    <p class="fs-12 mg-btm-10">1. Elementos con dos o más cores pasan a un color único.
			</p>
                    <p class="fs-12 mg-btm-10">2. razados muy finos pueden perder su detalle.
			</p>
                    <p class="fs-12 mg-btm-10">3. Utilizá siempre imagenes en alta resolución para garantizar buena calidad en el elemento.
			</p>
                    <p class="fs-12 mg-btm-10">
                        <strong>4. No utilice el QR Code generado por Instagram.</strong>
                    </p>
                    <p class="fs-12 mg-btm-30">
                        Se recomienda que el imagen tenga una resolución de por lo menos <strong>300 DPI</strong>
                        .
			
                    </p>
                    <p class="fs-12 mg-btm-30">Ejemplo:
			</p>
                    <img src="https://ecovasos.com/qero/assets/personalizacion_online/images/media/logo-example.png" alt="">
